package com.vlearn.android.setting.mykid;

public class ClassCollection {

	
	String class_id;
	String class_name;
	String class_type_id;
	String grade_name;
	String type_name;
	String rosters;
	String student_count;
	
	public ClassCollection(String class_id, String class_name, String class_type_id, String grade_name, String type_name, String rosters, String student_count) {
		// TODO Auto-generated constructor stub
	
		this.class_id = class_id;
		this.class_name = class_name;
		this.class_type_id = class_type_id;
		this.grade_name = grade_name;
		this.type_name = type_name;
		this.rosters = rosters;
		this.student_count = student_count;
	}
	
}
